import React from 'react';

const GridCard = ({card}) => {
    const src = card ? card.img : 'back.png';

    return ( 
        <div className='grid-card'>
            <img src={require(`../assets/images/${src}`)} alt=""/>
            <div className="description"></div>
        </div>
     );
}

export default GridCard;
